import { Box, Button, Stack, TextField, Typography } from "@mui/material";
import React from "react";
import CustomButton from "../../../../../components/CustomButton";
import Wrapper from "./components/Wrapper";

const Step2 = ({ setActiveStep }) => {
  return (
    <Wrapper icon="/images/suggested.svg" title="Suggested 5-Fi network layout">
      <Box>
        <Stack direction={"row"} gap={"34px"} alignItems={"center"}>
          <Box
            sx={{
              background: "#F2F2F2 0% 0% no-repeat padding-box",
              padding: "19px 25px",
            }}
          >
            <Typography
              sx={{
                fontFamily: "Poppins",
                fontWeight: "400",
                fontSize: "22px",
                lineHeight: "33px",
                color: "#030303",
              }}
            >
              Number of Access points required is <strong>5</strong>
            </Typography>
          </Box>
          {/* <CustomButton background={"#1F3BB3"} onClick={() => setActiveStep(2)}>
            Order Now
          </CustomButton> */}
        </Stack>

        <Box
          sx={{
            background: "#FFFFFF 0% 0% no-repeat padding-box",
            border: "0.5px solid #B1AFAF",
            borderRadius: "5px",
            padding: "28px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "61px",
          }}
        >
          <img
            src={"/images/blueprint.png"}
            height="616px"
            width="1070px"
            alt="blueprint"
            style={{ objectFit: "cover" }}
          />
        </Box>
      </Box>
    </Wrapper>
  );
};

export default Step2;
